export default function SearchBar(props) {
   let id;
   const handleChange = (e) => {
      id = e.target.value;
      console.log(id);
    };
   return (
      <div>
         <input type='search' onChange={handleChange}/>
         <button onClick={(id) => {props.onSearch(id)}}>Agregar</button>
      
      </div>
   );
}
